var BuyPopUpHide, BuyPopUpShow;

$("#playbill .calendar a").click(function(e) {
  e.preventDefault();
  if ($(this).attr("class") !== "active") {
    $("#playbill .calendar a").removeClass("active");
    $(this).addClass("active");
    if ($("#playbill .event").attr("class") !== "active") {
      $("#playbill .event").addClass("active");
      if ($($(this).attr("href")).attr("class") !== "active") {
        $("#playbill .event").removeClass("active");
        return $($(this).attr("href")).addClass("active");
      }
    }
  } else {
    $($(this).attr("href")).removeClass("active");
    $(this).removeClass("active");
    return $("#playbill .event").removeClass("active");
  }
});

BuyPopUpShow = function() {
  return $('.buy-popup').show();
};

BuyPopUpHide = function() {
  return $('.buy-popup').hide();
};

$(document).ready(function() {
  return BuyPopUpHide();
});

$('.buy-button').click(function(e) {
  e.preventDefault();
  e.stopPropagation();
  return BuyPopUpShow();
});

$(".mainMenu .mainMenu-item > a").click(function(e) {
  var mainMenuItem, mainMenuItems, mainMenuLink, sideMenu, sideMenus;
  mainMenuLink = $(this);
  mainMenuItem = mainMenuLink.parent();
  mainMenuItems = mainMenuItem.parent().children();
  sideMenu = mainMenuItem.children(".sideMenu");
  sideMenus = mainMenuItems.children(".sideMenu");
  if ($(window).width() <= 1440) {
    e.preventDefault();
    if (!sideMenu.is(':visible')) {
      sideMenus.hide();
      return sideMenu.show();
    } else {
      return sideMenu.hide();
    }
  }
});

